import React from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import Tickets from '../..Protected_Apps/TechnicianTickets/TechnicianTickets'; // Import the Tickets component

function MyApplication() {
    return (
        <div>
            <h2>My Services</h2>
            <ul>
                <li><Link to="hr-hub">HR Hub</Link></li>
                <li><Link to="expense-hub">Expense Hub</Link></li>
                <li><Link to="tool-manager">Tool Manager</Link></li>
                <li><Link to="tickets">Tickets</Link></li>
            </ul>

            <Routes>
                <Route path="tickets" element={<Tickets />} />
                {/* Add Routes for other apps (HR Hub, Expense Hub, Tool Manager) if needed */}
            </Routes>
        </div>
    );
}

export default MyApplication;
